	(91,1,'2019-03-06 17:50:21','2019-03-06 17:50:21','Hey, friends! I’m excited to finally announce a new challenge that I’ve been working on behind the scenes! With this <strong>FREE&nbsp;10-Day Challenge</strong>, you will get your kitchen clean, organized, and restocked for a fresh start in the New Year!\n\nWe will use printable checklists and friendly support to take an overwhelming task and break it down into manageable daily assignments. You won\'t believe the final results at the end of the 10 days! Are you ready to get started?!\n\n<img class=\"aligncenter wp-image-42081 size-full\" src=\"https://www.theseasonedmom.com/wp-content/uploads/2017/12/10-Day-Kitchen-Challenge.jpg\" alt=\"A 10-Day Challenge to Clean, Organize and Restock Your Kitchen! Home Organization | Cleaning Hacks | Cleaning Schedule #kitchen #organization #cleaning\" width=\"750\" height=\"2250\">\n\n<script async=\"\" id=\"_ck_298590\" src=\"https://forms.convertkit.com/298590?v=6\"></script>\n\nAfter we had such great success with <a href=\"https://www.theseasonedmom.com/5-day-challenge/\" rel=\"false noopener\"><strong>my 5-Day Meal Planning Challenge</strong></a> last summer, I\'ve received a number of requests for additional Challenges in the future.\n\nI figure the start of a New Year is the perfect time to step out of our comfort zone, tackle those nagging projects that we\'ve put off during the holidays, and get organized for success in the months ahead.\n\n<img class=\"aligncenter wp-image-42082 size-full\" src=\"https://www.theseasonedmom.com/wp-content/uploads/2017/12/Kitchen-Challenge-1.jpg\" alt=\"A 10-Day Challenge to Clean, Organize and Restock Your Kitchen! Home Organization | Cleaning Hacks | Cleaning Schedule #kitchen #organization #cleaning\" width=\"735\" height=\"1102\">\n\n<span style=\"font-size: 18pt;\"><strong>So here\'s how it will work:</strong></span>\n\nWhen you join <a href=\"https://theseasonedmom.lpages.co/10-day-kitchen-organizing-challenge/\" target=\"_blank\" rel=\"false noopener noreferrer\"><strong>the free Challenge</strong></a>, I will send you a new set of simple instructions via email each day for 10 days in a row. You will spend anywhere from 5-25 minutes per day working through the “assignment.”\n\nBy the end of the 10 days, you will have a clean, organized, and fully-stocked kitchen!\n\n<span style=\"font-size: 18pt;\"><strong>You will:</strong></span>\n<ul>\n 	<li><span style=\"font-size: 14pt;\">Organize your spices;</span></li>\n 	<li><span style=\"font-size: 14pt;\">Organize your pantry and stock your cabinets with staples that make last-minute meals easy;</span></li>\n 	<li><span style=\"font-size: 14pt;\">Clean, organize, and stock your refrigerator;</span></li>\n 	<li><span style=\"font-size: 14pt;\">Clean, organize, and stock your freezer;&nbsp;</span></li>\n 	<li><em><span style=\"font-size: 14pt;\">and so much more!!!</span></em></li>\n</ul>\nI will share all of my best tips, tools, and checklists to make the process easy, manageable, and maybe even...<em>fun</em>?!\n\n<img class=\"aligncenter wp-image-41765 size-full\" src=\"https://www.theseasonedmom.com/wp-content/uploads/2017/11/Kitchen-Tour-5.jpg\" alt=\"A 10-Day Challenge to Clean, Organize and Restock Your Kitchen! Home Organization | Cleaning Hacks | Cleaning Schedule #kitchen #organization #cleaning\" width=\"750\" height=\"1129\">\n\nI hope that you\'ll join me in <a href=\"https://theseasonedmom.lpages.co/10-day-kitchen-organizing-challenge/\" target=\"_blank\" rel=\"false noopener noreferrer\">the free 10-Day Challenge</a>,&nbsp;which I will begin <strong>live on Monday, January 1.</strong>&nbsp; If you\'re joining this Challenge <em>after January 1</em>, that\'s fine too! You can work through each day at your own pace.\n\nI have also set up a closed Facebook group to support you in this Challenge, where I can answer questions, share tips, and connect with all of you live each day. You will be able to join the Facebook group when you enter the Challenge.\n\n<span style=\"font-size: 18pt;\"><strong>If you\'re ready to join me in cleaning, organizing, and restocking your kitchen, please sign up <a href=\"https://theseasonedmom.lpages.co/10-day-kitchen-organizing-challenge/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">HERE</a>!</strong></span>\n\n<script async=\"\" id=\"_ck_298590\" src=\"https://forms.convertkit.com/298590?v=6\"></script>','10-Day Challenge: Clean, Organize & Restock Your Kitchen!','','trash','open','open','','10-day-challenge-clean-organize-restock-your-kitchen__trashed','','','2019-03-11 20:54:43','2019-03-11 20:54:43','',0,'https://ck.test/?p=91',0,'post','',0),
