each day. You will be able to join the Facebook group when you enter the Challenge.</p>\n<p><span style=\"font-size: 18pt;\"><strong>If you\'re ready to join me in cleaning, organizing, and restocking your kitchen, please sign up <a href=\"https://theseasonedmom.lpages.co/10-day-kitchen-organizing-challenge/\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">HERE</a>!</strong></span></p>\n<p><script async=\"\" id=\"_ck_298590\" src=\"https://forms.convertkit.com/298590?v=6\"></script></p>\n<!-- /wp:html -->','10-Day Challenge: Clean, Organize & Restock Your Kitchen!','','inherit','closed','closed','','91-revision-v1','','','2019-03-06 17:50:21','2019-03-06 17:50:21','',91,'https://ck.test/91-revision-v1/',0,'revision','',0),
